import Header from './Header';
import StoryCard from './StoryCard';

export default class Pending extends Component {
  render(){
    return (
      <div>
        <Header title="Pending Stories" />
        <StoryCard />
        <StoryCard />
        <StoryCard />
      </div>

    )
  }
}
